function CreateExercise(){
    const {
        createValue,
        setCreateValue,
        setOpenModal
    } =React.useContext(ContextGlobal)
    return(
        <div>
            <button 
            onClick={()=>{
                setOpenModal(state => !state) // Con este metodo puedo actualizar el modal en pantalla al darle  click, aparece o desaparece segun el caso
